import React from "react";
import {useSelector} from "react-redux";

export default function FirstColumn() {

    const full_data = useSelector(state => state);

    const [inf, setInf] = React.useState([])

    React.useEffect(() => {

        full_data.then(
            res=> {
                setInf(res)

            })

    }, [inf]);
    console.log(inf)
    return (
        <div className="column">
            {(inf.length === 0) ?
                <p>downloading</p>
            :


                inf.forEach((node) => (
                <p key={node}>node.node_name</p>
                ))
            
            }
        </div>
    );
}
